import React from 'react'

const Course = ({ course }) => {
    console.log(course)
    return (
        <div>
            <Header name={course.name} />
            <Content parts={course.parts} />
            <Total />
        </div>
    )
}

const Header = ({ name }) => {
    return (
        <h2>{name}</h2>
    )
}

const Content = ({ parts }) => {
    return (
        <div>
            {parts.map((part) => <Part id={parts.id} name={parts.name} exercises={parts.exercises} />)}
        </div>

    )
}
const Part = ({ name, exercises }) => {
    return (
        <p>{name} {exercises}</p>
    )
}
const Total = () => {
    return (
        <strong></strong>
    )
}

export default Course
